<p>I am trying to save the string of arrays &quot;jobType&quot;.
context: I am creating an app where people can post jobs.
each job can have multiple types.</p>
<p>here is my job model::</p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require(&quot;mongoose&quot;);

const postSchema = mongoose.Schema({
  content: { type: String, required: true },
  imagePath: { type: String, required: true },
  state: { type: String, required: true },
  substate: { type: String, required: true },
  address: { type: String, required: true },
