How to project a sum of a field in a sub-document based on a condition in MongoDB?<p>I have a Customer collection with the following document:</p>
<pre><code>{
  &quot;_id&quot;: 1,
  firstname: &quot;John&quot;,
  lastname: &quot;Doe&quot;,
  credits: [
    {
      cDate: &quot;2020-01-16&quot;,
      cAmount: 350
    },
    {
      cDate: &quot;2021-02-07&quot;,
      cAmount: 180
    },
    {
      cDate: &quot;2021-06-25&quot;,
      cAmount: 650
    },
  ]
}
{
  &quot;_id&quot;: 2,
  firstname: &quot;Bob&quot;,
  lastname: &quot;Smith&quot;,
  credits: [
    {
      cDate: &quot;2020-03-19&quot;,
      cAmount: 200
    },
    {
      cDate: &quot;2020-08-20&quot;,
      cAmount: 90
    },
    {
      cDate: &quot;2021-11-11&quot;,
      cAmount: 300
    },
  ]
}
</code></pre>
<p>Now I would like to return the total spent for a specific year i.e. 2021.<br />
The data should look something like this:</p>
<pre><code>{&quot;firstname&quot;: &quot;John&quot;, &quot;lastname&quot;: &quot;Doe&quot;, &quot;total&quot;: 830},
{&quot;firstname&quot;: &quot;Bob&quot;, &quot;lastname&quot;: &quot;Smith&quot;, &quot;total&quot;: 300}
</code></pre>
<p>First I tried to match the records that contain <code>cDates</code> within the expected year (2021) to reduce the number of records (the actual dataset has hundreds of customers) and then projected the wanted fields:</p>
<pre><code>Customer.aggregate([
  {
    $match: {
      credits: {
        $elemMatch: {
          cDate: {
            $gte: ISODate(&quot;2021-01-01&quot;),
            $lte: ISODate(&quot;2021-12-31&quot;),
          },
        },
      },
    },
  },
  {
    $project: {      
      _id: 0,
      firstname: 1,
      lastname: 1,
      total: {
        $sum: &quot;$credits.cAmount&quot;,
      },
    },
  }
])
</code></pre>
<p>the result is:</p>
<pre><code>{&quot;firstname&quot;: &quot;John&quot;, &quot;lastname&quot;: &quot;Doe&quot;, &quot;total&quot;: 1180},
{&quot;firstname&quot;: &quot;Bob&quot;, &quot;lastname&quot;: &quot;Smith&quot;, &quot;total&quot;: 590}
</code></pre>
<p>Almost there, now I'd like to skip the credit records that do not contain the expected year (2021), so that only the values with a <code>cDate</code> equal to 2021 are calculated.<br />
The <code>$match</code> I kept the same and I tried to add a <code>$cond</code> in the <code>$project</code> bit.</p>
<pre><code>Customer.aggregate([
  {
    $match: {
      credits: {
        $elemMatch: {
          cDate: {
            $gte: ISODate(&quot;2021-01-01&quot;),
            $lte: ISODate(&quot;2021-12-31&quot;),
          },
        },
      },
    },
  },
  {
    $project: {      
      _id: 0,
      firstname: 1,
      lastname: 1,
      total: {        
        $cond: {
          if: { credits: { cDate: { regex: &quot;2021-&quot; } } }, // if cDate contains 2021-
          then: { $sum: &quot;$credits.cAmount&quot; },             // add the cAmount
          else: { $sum: 0 }                               // else add 0
        },
      },
    },
  }
])
</code></pre>
<p>This results is still the same, all totals get calulated from all years.</p>
<pre><code>{&quot;firstname&quot;: &quot;John&quot;, &quot;lastname&quot;: &quot;Doe&quot;, &quot;total&quot;: 1180},
{&quot;firstname&quot;: &quot;Bob&quot;, &quot;lastname&quot;: &quot;Smith&quot;, &quot;total&quot;: 590}
</code></pre>
<p>What am I missing?<br />
Thanks for your help.</p>

